import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import NavbarIn from "./navbar/NavbarIn";

class Profile extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

  render() {
    return (
      <div>
        <NavbarIn />
        <br />
        <br />
        <br />
        <h1 className="tc white i f1 font">My Profile</h1>
        <br />
        <br />

        <Container className='tc f3 solidBR'>
        <u><i className='f2'>General settings</i></u> 
          <Row>
            
          <Col className='br'>
              
          </Col>       

            <Col className="pa5">
               <br/>
              <p className='black' >- Deposit Into Account</p><br/> 
              <p className='black' >- Withdraw From Account</p><br/> 
              <p className='black' >- Current Account Statement</p><br/> 
              <p className='black' >- Betting History</p><br/> 
              <p className='black' >- Full Fincial Statement</p><br/> 
              <p className='black' >- Delete Your Account</p><br/> 
            </Col>
          </Row>
          <Row>
          <Col>
            
          </Col>  
            <Col className='bl'>
              
            </Col>
          </Row>
        
        </Container>
        <br/>
      </div>
    );
  }
}

export default Profile;
